import React from 'react';
//import './Home.css';

function Home() {
  return (
    <div className= "page-home">
      <div className='title-intro'> 
          WILD CIRCUS
      </div>
      <div className='title'>
        Bienvenue  
      </div>
      <div className='text-intro'>
        Nous sommes heureux de vous accueillir et de vous faire découvrir notre univers circassien nouvelle génération.
        Ici, vous ne verrez aucun animal, mais notre troupe saura vous faire oublier le temps et vous faire voyager dans son univers féérique et extraordinaire.
        Passionnés par otre métier et ayant à coeur de le  partager avec le plus grand nombre, nous avons pris le parti d'offrir la gratuité de l'entrée à chaque enfant.


      </div>


    </div>
  )
}

export default Home;
